// ==UserScript==
// @name         Site blocker
// @namespace    https://github.com/smkapilgupta/siteBlocker2
// @version      1.0.1
// @description  Script to block any site with nsfw regular expression. Redirects to a different website instead.
// @author       Kapil Gupta <smkapilgupta@gmail.com>
// @match        *://*/*
// @run-at       document-start
// @grant        window.onurlchange
// @grant        GM_addStyle
// @grant        GM_setValue
// @grant        GM_getValue
// @require      http://code.jquery.com/jquery-2.2.4.js
// @updateURL    https://raw.githubusercontent.com/smkapilgupta/siteBlocker2/main/siteBlocker.user.js?v=1
// @downloadURL  https://raw.githubusercontent.com/smkapilgupta/siteBlocker2/main/siteBlocker.user.js?v=1
// @icon         data:image/png;base64,
// ==/UserScript==

'use strict';
const blockedWebsitesRegex="youtube"
const blockRegex="://[^/=?]*("+blockedWebsitesRegex+")"
const redirectTo=["https://www.howtogeek.com", "https://techcrunch.com/","https://www.makeuseof.com","https://gameranx.com","https://swarajyamag.com/","https://www.businessinsider.in", "https://store.steampowered.com", "https://venturebeat.com", "https://www.firstpost.com","https://www.engadget.com"]


function rerender(){
    $("body").css("visibility","hidden");

    $(document).ready(function() {
        var oldBody = $('body').html();
        $('body').html('<div id="NewContent">Content Blocked.</div>');
        $("body").css("visibility","visible");

        GM_addStyle(`#NewContent {
height: 300px;
margin: 50px;
padding: 50px;
font-size:20pt;
text-align:center;
}`);


        $("body a").click(function() {
        $('body').html(oldBody);
    });

});
}

function obliterateNode(node){
  if(!node)
    return
  node.innerHTML=""
  node.innerText=""
  Object.keys(node).forEach(key=>{
      node[key] = undefined;
  })
}

function udpateRecords(records){
  records.forEach(record => {
    record.addedNodes.forEach(node => {
      obliterateNode(document.body)
      obliterateNode(document.head)
      if (node.nodeType === Node.ELEMENT_NODE) {
        obliterateNode(node.parent?node.parent:node)
        if(node.tagName === 'SCRIPT')
          node.type = 'javascript/blocked'
      }
    });
  });
}

const mutationObserver=new MutationObserver(udpateRecords)

function generateRandomNumber(rangeStart, rangeEnd){
    let lastRN=GM_getValue("lastRN")
    lastRN=lastRN?lastRN:0
    let uuid=String(crypto.randomUUID())
    var sumOfChars=0;
    for(let i=0;i<uuid.length;i++){
        sumOfChars+=Number(uuid.charCodeAt(i))
    }
    let newRN= rangeStart+(lastRN+sumOfChars)%(rangeEnd-rangeStart+1)
    if(newRN === lastRN)
        newRN=rangeStart+(lastRN+sumOfChars+1)%(rangeEnd-rangeStart+1)
    GM_setValue("lastRN",newRN)
    return newRN
}

function checkNBlock() {
    'use strict';

    const url=window.location.href

    if(url.match(new RegExp(blockRegex))){
        console.log("URL matched with block regex")
        mutationObserver.observe(document, {childList: true, subtree: true});
        rerender()
        window.location.replace(redirectTo[generateRandomNumber(0,redirectTo.length-1)])

    }
    else{
    }
};

checkNBlock()
